INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3560070847204', 'Macaroni jambon fromages', 'Pâtes macaroni cuites aux œufs 41% (eau, semoule de blé dur, œufs), eau, crème fraîche, jambon cuit supérieur fumé 11% [jambon de porc (origine : France), sel, dextrose, arômes naturels, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium], emmental râpé 9%, mozzarella râpée 3% (lait de vache, sel, ferments (dont lactose), coagulant,  anti-agglomérant : amidon de pomme de terre), huile de tournesol, farine de blé, lactose et protéine de lait, sel, épaississant : gomme xanthane, poivre, ail poudre.', 'https://static.openfoodfacts.org/images/products/356/007/084/7204/front_fr.34.400.jpg', '8.3', '4.4', '15', '1.2', '0.6', '8.2', '0.48', '0.188976377952756', '', '1');

