VALUES ('3560070847235', 'Nouilles légumes poulet curry vert', 'Pâtes alimentaires cuites 47% (eau, semoule de blé dur), morceaux de filet de poulet tranchés (origine France) 14%, eau, carotte 4%, sauce soja (eau, graines de soja, sel, farine de blé), fève 2,7%, châtaigne d\'eau 2,7%, poivron rouge 2,4%, champignon noir 2%, huile de tournesol, oignon préfrit 1,5% (oignon, huile de tournesol), fond de volaille aromatisé (maltodextrine, arômes naturels, graisse et viande de volaille, sel, fécule de pomme de terre, lactose, extrait d\'oignon), gingembre, huile de sésame grillé, jus de citron, sucre, épices (curcuma, coriandre, graines de moutarde, fenugrec, cumin, piment fort, poivre), pulpe d\'ail, citronnelle, curry vert en poudre 0,1% (piment vert, coriandre, ail, échalote, gingembre, cumin), citron en poudre, sel, épaississant : gomme xanthane.', 'https://static.openfoodfacts.org/images/products/356/007/084/7235/front_fr.45.400.jpg', '3.1', '0.4', '14', '0.9', '1.6', '7.6', '0.75', '0.295275590551181', '', '1');

