VALUES ('3560070847266', 'Bon App Risotto Poulet Champignons', 'Sauce à la crème et aux champignons 63,3% : Crème fraîche 25,3%, eau, oignon 4,4%, vin blanc 3,1%, champignons de Paris 1,9% (champignons de Paris, eau, sel, acidifiant: acide citrique, antioxydant : acide ascorbique), ail, amidon modifié de pomme de terre, parmesan, sel, sucre, épaississant : gomme xanthane, poivre blanc. Riz cuit 20% : Riz étuvé 16,6%, eau. Filets de poulet rôti traité en salaison 10%: Filet de poulet 9,3%, eau, maltodextrine, sel, amidon de maïs, dextrose, sirop de glucose. Champignons de Paris 6.7% : Champignons de Paris, eau, sel, acidifiant: acide citrique, antioxydant: acide ascorbique', 'https://static.openfoodfacts.org/images/products/356/007/084/7266/front_fr.14.400.jpg', '7.5', '4.6', '15', '1.7', '0.6', '4.3', '0.7', '0.275590551181102', '', '1');

