INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3560070847501', 'Pain de campagne surprise', 'Pain de campagne 67,4% : Farine de blé (farine de blé, gluten de blé, farine de blé malté), eau, huile de tournesol, farine de seigle (farine de seigle, remoulage de seigle, farine de blé, gluten de blé, farine d\'orge torréfiée, farine de blé malté), levure, sucre, sel, lait écrémé en poudre, émulsifiants : mono - et diglycérides d\'acides gras et stéaroyl-2-lactylate de sodium, malt d\'orge torréfié, antioxydant : acide citrique.    Préparation à base de saumons, fromage blanc, citrons confits et ciboulette 8,7% : Saumon fumé 2,4% [saumon (Salmo salar), sel], fromage blanc 2,2%, saumon cuit 1,9% (Salmo Salar), crème fraîche, écorce de citron confit 0,6% (écorce de citron 0,4%, sucre, jus de citron concentré), ciboulette 0,2%, jus de citron concentré.    Mousse de canard au porto et figues 8,7% : Mousse de canard  au porto 6,2% (graisse de canard, foie maigre de canard, eau, foie gras de canard, œuf, Porto 0,1%, lait écrémé en poudre, sel, amidon transformé de maïs, protéines de lait, dextrose, épices (poivre, coriandre, cannelle, carvi, girofle, muscade, piment), antioxydant : ascorbate de sodium, conservateur : nitrite de sodium), eau, figues sèches 0,5% (figues, farine de riz), préparation en poudre pour sauce blanche (lactosérum, amidon modifié de pomme de terre, matière grasse de colza, lait écrémé en poudre, sel, farine de blé, protéines de lait, sirop de glucose, arômes naturels), antioxydant : acide ascorbique.    Préparation à base de fromage blanc, concombre et menthe douce 8,7% : Fromage blanc 6,2%, concombre 2,1%, sel, menthe douce 0,07%, amidon modifié de tapioca, épaississants : farine de graines de caroube et gomme xanthane, protéines de lait, persil.    Jambon sec et beurre à la moutarde à l\'ancienne 6,5% : Jambon sec 4,3% (jambon de porc, sel, dextrose, conservateur : nitrate de potassium), eau, beurre 0,6%, préparation en poudre pour sauce blanche (lactosérum, amidon modifié de pomme de terre, matière grasse de colza, lait écrémé en poudre, sel, farine de blé, protéines de lait, sirop de glucose, arômes naturels), moutarde à l\'ancienne 0,1% (vinaigre d\'alcool, graines de moutarde, eau, sel, sons de moutarde, acidifiant : acide citrique, épices (contient céleri)).    Peut contenir des traces de : soja, fruits à coque, crustacés, graines de sésame. Les pourcentages sont exprimés sur l\'ensemble du produit.', 'https://static.openfoodfacts.org/images/products/356/007/084/7501/front_fr.14.400.jpg', '8.6', '2.7', '37', '4.8', '3.2', '9.1', '1.5', '0.590551181102362', '', '0');

