VALUES ('3560070852833', 'Tarte fine champignons fromages', 'Garniture 57,4% : Mélange de champignons 14,8% (pleurotes, bolets jaunes, bolet bais, cèpes, champignons de Paris, shiitake), eau, crème fraîche 12%, emmental râpé 7,4%, parmesan AOP 4,4%, fromage fondu 4% (fromages 2%, eau, beurre, lait écrémé en poudre, lactosérum, amidon transformé de pomme de terre, sel de fonte : citrates de sodium, sel), lactose et protéines de lait, amidon transformé de pomme de terre, arôme naturel (contient lait), persil, écrémé en poudre, amidon de riz Pâte 42,6% : Farine de Elé, eau, huile de tournesol, sel. Peut contenir des traces de poissons, œufs, crustacés, mollusques et moutarde. Les pourcentages sont exprimés sur l\'ensemble du produit. @ Fijne taart met paddenstoelen, kaas en room ? Diepvries. Ingrediënten: Garnituur 57,4%: Mengeling van paddenstoelen 14,8% (oesterzwammen, bruine ringbole(en? kastanjeboleten, eekhoorntjesbrood, Parijse champignons, shiitake), water, verse 12%, geraspte 7,4%, parmezaan BOB 4,4%, smeltkaas 2%, water, boter, magere melkpoeder, gemodificeerd aardappelzetmeel, smeltzout: natriumcitraten, zout), lactose en me!keiwitten, gemodificeerd-aardappelzetmeel, natuurlijk aroma (bevat peterselie, magere mgl&poeder, rijstzetmeel, Deeg 42,6%: water, zonnebloemolie, zout?', '', '11', '6.2', '24', '2.3', '1.3', '8', '1', '0.393700787401575', '', '1');

